import React from "react";

class Noeuds extends React.Component {
  constructor() {
    super();
    this.state = {
      allNodes: []
    };
  }

  callNoeuds() {
    fetch("http://localhost:9000")
      // .then(res => console.log(res))
      .then(res => res.text())
      .then(res => this.setState({ allNodes: res }))
      .then(err => err);
  }

  componentDidMount() {
    this.callNoeuds();
  }

  render() {
    return (
      <div>
        <ul>
          {this.state.allNodes.map(item => {
            console.log(item);
            return `<li key${item.id}=>${item.name}</li>`;
          })}
        </ul>
      </div>
    );
  }
}

export default Noeuds;
